import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <link className="navbar-brand" href="/search">
        Find a new book
      </link>
      <Link className="navbar-brand" to="/saved">
        Books you like
      </Link>
    </nav>
  );
}

export default Nav;
